import React from "react";

import HomeText from './HomeText';
import NavBar from './NavBar';
const HomePage = () => {
    return (
        <div className="bg-gym1 min-h-screen flex flex-col items-center justify-center">
            <NavBar /> 
            <HomeText/>
        </div>
    );
};

export default HomePage;
